import React from "react";
import Card from "../UI/Card";


const MissionHeader = (props) => {
  return (
    <>
      <Card className="w-full bg-blue-300 px-8">
        <div className="grid grid-cols-2 gap-8">
          <div>
            <label>Créneau de tournée</label>
            <input
              type="datetime-local"
              name="shift_date"
              id="shift_date"
              required
            ></input>
          </div>
          <div>
            <label className="text-gray-700">Dispatcher name:</label>
            <input type="text" name="dispatcherName" className="w-full h-fit"></input>
          </div>
        </div>
      </Card>
    </>
  );
};
export default MissionHeader;
